import React, { Component } from "react";
import logo from "./logo.svg";
import redHeart from "icons/red_heart.png";
import blueHeart from "icons/blue_heart.png";
import ImageComponent from "./imageComponent.js";
import UploadForm from "./UploadBtn";
import "./App.css";
import TypeUpdater from "./typeUpdater";

class App extends Component {
  render() {
    return (
      <div className="App">
          <header className="App-header">
              <img src={logo} className="App-logo" alt="logo" />
              <p style={{color: "black"}}>Logo???</p>
              <TypeUpdater />
              <UploadForm/>
          </header>
          <ImageComponent />
          <img src={redHeart} className="Heart" alt="red_heart" />
          <img src={blueHeart} className="Heart" alt="blue_heart" />
      </div>

    );
  }
}

export default App;
